import React, { useState } from 'react';

export default function ChildCallbackHookExample() {
    const [count5, setCount5] = useState(0);
    console.log("childcakkkkkk");
    const increment5 = () => {
        console.log("increment5");
        setCount5((prev) => prev + 5);
    }

    return (
        <>
            <h2>count5:{count5}</h2>
            <button onClick={() => increment5()}>Increment +5</button>
        </>
    );
}
